	show_arr(size, arr_shift2);
	show_arr(size, arr_shift3);
}

void shift1(int size, int arr[], int arr1[]) {	
	for (int k = 0; k < (size - 1); k++) {
		arr1[k + 1] = arr[k];
	}
	arr1[0] = 0;
}


void shift2(int size, int arr[], int m) {
	for (int k = (size - 1); k >= m; k--) {
		arr[k] = arr[k-m];
	}
	for(int k = 0; k < m; k++)
		arr[k] = 0;
}

