Uses
    System.SysUtils;

Var
    Num, I: Integer;                   //так -- а почему массив на 10 элементов? Задание на динамический массив -- это 100% бан точно
    Arr: Array [1 .. 10] Of Integer;   //принято писать [1..10], а если массив из изначально заданных числа элементов, то его размрность выносится в константы
