            IsCorrect := False;
        End;

    Until (IsCorrect);

    Writeln('Введите элементы массива.');

    For I := 1 To Num Do  //Табуляция полетела -- Repeat-Until и все, что у него внутри, должно быть на 4 пробела дальше от края
    Repeat
        IsCorrect := True;
        Try
            Write('Введите ', I, ' элемент массива: ');
            Readln(Arr[I]);
        Except
            Writeln('Введенные данные не соответствуют условию. Повторите попытку.');    //условия нет, но ошибки есть(
            IsCorrect := False;
        End;

    Until (IsCorrect);

    ArrSgl[1] := Arr[1];        //Когда будешь работать с динамическими -- будь аккуратна с индексацией
    ArrSgl[Num] := Arr[Num];    //В динамических она с 0

    For I := 2 To (Num - 1) Do
        ArrSgl[I] := (Arr[I - 1] + Arr[I] + Arr[I + 1]) / 3;

    Write('Вывод сглаженного массива: ');

    For I := 1 To Num Do        //Тут тоже
        Write(ArrSgl[I]:5:1, ' ');  //Вывод хороший, но будь готова за него пояснять при сдаче

    Readln;

End.

