uses
    System.SysUtils;

Var
    N, M, Placements, I: Integer;
    IsCorrect: Boolean;

Begin
    Writeln('Данная программа вычисляет число размещений из N по M.');
    Writeln('Условия ввода: N и M натуральные числа, при этом N больше M.');    //умничка! Только этот Writeln обычно заносится в цикл с проверкой

    Repeat
        IsCorrect := True;

        Try
            Write('Введите N: ');       //Вот тут не стоит использовать Readln(N, M); потому что есть конкретная разница, что вводить первым, в отличии от координат, везде принятых в определенном порядке записи
            Readln(N);
            Write('Введите M: ');
            Readln(m);                  //m маленькое -- только с большой
        Except
            Writeln('Введенные данные не соответствуют условию. Повторите попытку.');
            IsCorrect := False;
        End;

        If IsCorrect And ((N <= M) or (N < 0) or (M < 0)) Then                  //вот условие отношения N к M стоит тоже прописать выше + нестрогое неравентсво
        Begin                                                                   //пользователь может не шарить и подумает, что ввел правильно, а тут ошибка диапазона, о котором его не предупредили
            Writeln('Введенные данные не соответствуют условию. Повторите попытку.');
            IsCorrect := False;
        End;

    Until (IsCorrect);

    Placements := N;

    For I := (N - 1) Downto (N - M + 1) Do            //DownTo :)
    Begin
        N := N - 1;    //можно еще использовать Dec(N); -- делает то же самое, что и N := N - 1; но в народе имеет больше признания
        Placements := Placements * N;
    End;

    Writeln('Число размещений равно ', Placements);    //такой момент -- результат у тебя может быть числом большим относительно ввода, поэтому стоит поставить диапазон вводимых значений, чтобы избежать выхода за размер типа
    Readln;                                            //можешь запариться и посчитать предел, а можешь приблизительно на глаз прикинуть
End.

namespace T08._Balanced_Parenthesis
{
    internal class Program
    {
        static void Main(string[] args)
        {
            string input = Console.ReadLine();

            Stack<char> opening = new Stack<char>();

            for (int i = 0; i < input.Length; i++)
            {
                char currentChar = input[i];

                if (currentChar == '(' || currentChar == '[' || currentChar == '{')
                {
                    opening.Push(currentChar);
                }

                else
                {
                    if (opening.Count == 0)
                    {
                        Console.WriteLine("NO");
                        Environment.Exit(0);
                    }

                    if (currentChar == ')')
                    {
                        if (opening.Pop() != '(')
                        {
                            Console.WriteLine("NO");
                            Environment.Exit(0);
                        }
                    }
                    else if (currentChar == '}')
                    {
                        if (opening.Pop() != '{')
                        {
                            Console.WriteLine("NO");
                            Environment.Exit(0);
                        }
                    }
                    else if (currentChar == ']')
                    {
                        if (opening.Pop() != '[')
                        {
                            Console.WriteLine("NO");
                            Environment.Exit(0);
                        }
                    }
                }

            }

            Console.WriteLine("YES");
        }
    }
}

